import React, { useRef, useState, useEffect } from "react";
import ReactDOM from "react-dom";
import styled from "@emotion/styled";
import { useHorizontalScroll } from "./useSideScroll.tsx";
import { useScrollTo } from "./useScrollTo.tsx";

const Header = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;

  //   background-color: blue;
  //   margin-bottom: 100px;
  height: 50px;
  width: 100%;
  border: 1px solid black;
`;

const Body = styled.div`
  display: flex;
  width: 100%;
`;

const ItemBox = styled.div`
  display: flex;
  flex: 1;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 500px;
  border: 1px solid black;
`;

interface ItemProps {
  generation: number;
  people: string[];
}

const Item = ({ generation, people }: ItemProps) => {
  const [onMouse, setOnMouse] = useState<boolean>(false);
  const handleMouseEnter = () => {
    setOnMouse(true);
  };
  const handleMouseLeave = () => {
    setOnMouse(false);
  };

  return (
    <ItemBox onMouseEnter={handleMouseEnter} onMouseLeave={handleMouseLeave}>
      {onMouse ? (
        people.map((person, index) => (
          <div key={index}>{onMouse ? `${person}` : `${generation}대`}</div>
        ))
      ) : (
        <div>{generation}대</div>
      )}
    </ItemBox>
  );
};

const App = () => {
  const scrollRef = useHorizontalScroll();

  const scrollToPosition = (positionX : number) => {
    if(scrollRef.current) {
      scrollRef.current.scrollTo({
        left: positionX,
        behavior: 'smooth'
      })
    }
  }

  return (
    <>
    <NavigationBar f={scrollToPosition}></NavigationBar>
    <div className="App" ref={scrollRef} style={{ overflow: "auto" }}>
      <div style={{ whiteSpace: "nowrap" }}>
        <StoryBox></StoryBox>
      </div>
    </div></>
  );

}

const StoryBoxRoot = styled.div`
  display: flex;
  flex-direction: row;
  flex-wrap: nowrap;
  height: 50vw;
  width: 500vw;
  gap: 240px;
  margin-left: 36px;

  background: #EED555;
`

const Box = styled.div`
  width: 480px;
  border: 1px solid black;
`

const Story = styled.div`
  margin-top: 240px;
  margin-left: 12px;
  width: 480px;
  font-size: 20px;
`

const StoryBox = () => {

  return (
    <StoryBoxRoot>
    <Box>
      <Story>
        안녕
      </Story>

    </Box>
    <Box>
      안녕
    </Box>

    </StoryBoxRoot>
  )
}


const NavigationBarRoot = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  height : 112px;
  width : 90vw;
  position: fixed;
  top: 0;
  z-index: 100;
  margin: 48px;
`

const NavigationBarItem = styled.div`
  display: flex;
  align-items: center;
  font-size: 32px;
`
interface NavigationBarProps {
  f : (positionX : number) => void
}
const NavigationBar = ({f} : NavigationBarProps) => {
  return (
    <NavigationBarRoot>
      <NavigationBarItem onClick={() => f(0)}>[청주 김씨]</NavigationBarItem>
      <NavigationBarItem onClick={() => f(1000)}>15대</NavigationBarItem>
      <NavigationBarItem onClick={() => f(2000)}>16대</NavigationBarItem>
      <NavigationBarItem onClick={() => f(3000)}>17대</NavigationBarItem>
      <NavigationBarItem onClick={() => f(4000)}>18대</NavigationBarItem>
      <NavigationBarItem onClick={() => f(5000)}>19대</NavigationBarItem>
    </NavigationBarRoot>
  )
}


ReactDOM.render(
  <App/>
 ,
  document.getElementById("root")
);
